import React from 'react';
import "./Login.css"

export default class Login extends React.Component{
    constructor() {
        super();
    }

    onSubmit = (e) => {
        alert("登录成功")
        e.preventDefault();
    }
    render() {
        return(
            <div className="login-container">
                <form className="login-form-container" onSubmit={this.onSubmit}>
                    <label>
                        <svg className="icon svg-category" aria-hidden="true">
                            <use xlinkHref="#icon-category" />
                        </svg>
                        <input required type="number" minLength={6} maxLength={16}/>
                    </label>
                    <label>
                        <svg className="icon svg-category" aria-hidden="true">
                            <use xlinkHref="#icon-category" />
                        </svg>
                        <input required type="password" maxLength={20}/>
                    </label>
                    <button type="submit">登录/注册</button>
                </form>
            </div>
        )
    }
}
